  true,\n\t\"url\": null,\n\t\"notes\": \"The Birds of the Americas Family Presence
  Grids of the Gridded Species Distribution, Version 1  is a reclassified version
  of the original  grids of the bird species distribution maps of  North America,
  South America and the Caribbean Islands. The data include 1- kilometer presence/absence
  grids for individual species available in Geographic Coordinate System (GCS). The
  input vector layers were produced by a consortium led by NatureServe. The gridding
  and grid processing are done by the Columbia University Center for International
  Earth Science Information Network (CIESIN).\",\n\t\"owner_org\": \"d8a6202b-c0c3-463d-88a0-3bc021a178ed\",\n\t\"extras\":
